INSERT INTO companies (id, name, description, timetable, site, phone, address, rating, image, company_type, owner_id) VALUES (686, 'Студия «Амазонка»', 'Профессиональная команда поможет вам преобразиться и измениться, пока вы наслаждаетесь ароматным кофе, вкусным чаем. Парикмахеры выполнят простое или сложное окрашивание, подстригут вас, уложат волосы, соберут их в вечернюю или свадебную прическу. Посетив косметологический кабинет, вы подкорректируете форму бровей, нарастите ресницы, сделаете восковую, сахарную, лазерную эпиляцию, пилинг, обертывание, воспользуетесь кавитацией, позволяющей избавиться от целлюлита, жировых отложений. Нейл-мастера владеют различными техниками выполнения маникюра и педикюра, занимаются оформлением ногтей, покрытием их гель-лаком. Для всех проводимых процедур в салоне используют косметологические материалы ведущих производителей, таких как OPI, Gelish, Creative, Gehwol, Beauty Image, Aravia, Minx Professional, Dolce Vita. Персонал беспокоится не только о качестве предоставляемых услуг, а также о здоровье клиентов, поэтому стерилизует все инструменты, проводит кварцевание открытого типа.', '09:00 - 18:00, без выходных', 'http://example.com', '+7 (999) 999-99-99', 'ул. Красный проспект, 98', 4.8, '1529980239/k9onl8wuqw44vekxucur.jpg', 'SALON', 11);
INSERT INTO companies (id, name, description, timetable, site, phone, address, rating, image, company_type, owner_id) VALUES (687, 'Академия красоты «Персона»', 'Внимательные, квалифицированные специалисты ознакомятся с вашей проблемой, узнают об имеющихся пожеланиях, составят индивидуальную программу, куда включат эффективные процедуры, направленные на достижение положительного результата. В заведении вы можете проконсультироваться с трихологом, косметологом, воспользоваться аппаратной, эстетической, инъекционной косметологией. Сотрудники занимаются лечением акне и постакне, целлюлита, увеличением губ, устранением мимических морщин, коррекцией фигуры, улучшением цвета лица, омоложением кожи. Также здесь выполняют эпиляцию, фотоэпиляцию, оформляют брови, делают различные виды массажей. Для всех работ мастера используют импортные, сертифицированные средства, сохраняющие на долгое время полученные эффекты. Команда центра регулярно повышает профессиональный уровень, проходит обучение, где знакомится с популярными, актуальными косметологическими новинками, применение которых значительно улучшает внешний вид клиентов.', '09:00 - 18:00, без выходных', 'http://example.com', '+7 (999) 999-99-99', 'ул. Фрунзе, 108', 3.9, '1529980244/faweeo4vquaz3v5cje69.jpg', 'SALON', 6);
