INSERT INTO companies (id, name, description, timetable, site, phone, address, rating, image, company_type, owner_id) VALUES (867, 'Салон красоты «Блеск»', 'В уютном, по-домашнему теплом пространстве вас встретит доброжелательная команда мастеров ногтевого сервиса, мастеров эпиляции, визажистов, стилистов, которая создаст утонченный повседневный или вечерний образ. Большинство услуг студии посвящены маникюру и педикюру. Здесь вы можете побаловать себя классическим, европейским, горячим маникюром, придать форму ногтям, сделать аппаратный, карбамидный, частичный педикюр, обработку стопы. Услуги по восстановлению, лечению и уходу от IBX, Vitagel, INKI PROFI укрепят ногтевую пластину, увлажнят кутикулу, помогут отрастить натуральные длинные ногти. Мастера украшают ногти художественной росписью, стразами, втирками, литьем, слайдерами, покрывают ногти лаками CND, O.P.I, Gelish, E.M.I. и другими. Кроме этого, в студии оформляют брови, делают экспресс-макияж, укладывают волосы, собирают их в простые и сложные прически. В кабинете эпиляции избавляют от нежелательных волос на теле, используя воск. Особое внимание персонал уделяют безопасности клиентов: стерилизует и дезинфицирует режущие инструменты, применяет одноразовые материалы, проводит процедуры в перчатках.', '09:00 - 18:00, без выходных', 'http://example.com', '+7 (999) 999-99-99', 'ул. Пушкина, 127', 4.2, '1529980384/phpn24hdpjib6thn0cii.jpg', 'SALON', 13);
INSERT INTO companies (id, name, description, timetable, site, phone, address, rating, image, company_type, owner_id) VALUES (868, 'Центр «Flower»', 'Профессиональная команда поможет вам преобразиться и измениться, пока вы наслаждаетесь ароматным кофе, вкусным чаем. Парикмахеры выполнят простое или сложное окрашивание, подстригут вас, уложат волосы, соберут их в вечернюю или свадебную прическу. Посетив косметологический кабинет, вы подкорректируете форму бровей, нарастите ресницы, сделаете восковую, сахарную, лазерную эпиляцию, пилинг, обертывание, воспользуетесь кавитацией, позволяющей избавиться от целлюлита, жировых отложений. Нейл-мастера владеют различными техниками выполнения маникюра и педикюра, занимаются оформлением ногтей, покрытием их гель-лаком. Для всех проводимых процедур в салоне используют косметологические материалы ведущих производителей, таких как OPI, Gelish, Creative, Gehwol, Beauty Image, Aravia, Minx Professional, Dolce Vita. Персонал беспокоится не только о качестве предоставляемых услуг, а также о здоровье клиентов, поэтому стерилизует все инструменты, проводит кварцевание открытого типа.', '09:00 - 18:00, без выходных', 'http://example.com', '+7 (999) 999-99-99', 'ул. Фрунзе, 147', 1.4, '1529980192/z2x1h9sgg8ryvmxw8j61.jpg', 'SALON', 9);
